import React from 'react';
import { Card, CardHeader, CardBody, Row, Col, Table, FormGroup, Label, Input, Button } from "reactstrap";

const ScheduleRow = ({ slNo, date, batchID, time, link }) => {
  return (
    <tr>
      <td>{slNo}</td>
      <td>{date}</td>
      <td>{batchID}</td>
      <td>{time}</td>
      <td><a href={link} target="_blank" rel="noopener noreferrer">{link}</a></td>
    </tr>
  );
};

const ScheduleTable = ({ scheduleData }) => {
  return (
    <Row>
      <Col md="12">
        <Card>
          <CardHeader>
            <h5 className="title">Schedule Table</h5>
          </CardHeader>
          <CardBody>
            <Table responsive>
              <thead className="text-primary">
                <tr>
                  <th>SlNo</th>
                  <th>Date</th>
                  <th>BatchID</th>
                  <th>Time</th>
                  <th>Link</th>
                </tr>
              </thead>
              <tbody>
                {scheduleData.map((scheduleItem, index) => (
                  <ScheduleRow
                    key={index}
                    slNo={scheduleItem.slNo}
                    date={scheduleItem.date}
                    batchID={scheduleItem.batchID}
                    time={scheduleItem.time}
                    link={scheduleItem.link}
                  />
                ))}
              </tbody>
            </Table>
          </CardBody>
        </Card>
      </Col>
    </Row>
  );
};

export default ScheduleTable;
